import React from "react";
import "./Header.css";

const Header = ({ selectedSector }) => (
  <div className="header">
    <div className="header-top">
      <div className="company-name">Smart Maintenance X</div>
      <div className="user-name">Tech RealM X</div>
    </div>
    <div className="page-title">Predictive Maintenance / {selectedSector}</div>
    <div className="last-updated">Last Updated: {new Date().toLocaleString()}</div>
  </div>
);

export default Header;
